import classes from "./MealItem.module.css";
const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Chikken Tikka",
    description: "Grilled Spicy Chicken",
    price: 250,
  },
  {
    id: "m2",
    name: "Biryani",
    description: "Masala Rice with beef",
    price: 220,
  },
  {
    id: "m3",
    name: "Chicken Handi",
    description: "Pakistan special handi",
    price: 450,
  },
  {
    id: "m4",
    name: "Malai Boti",
    description: "Healthy and tendered Chicken",
    price: 300,
  },
];

function MealsCart(props) {
  return (
    <div>
      {props.mealsList.map((meal) => {
        return (
          <div className={classes.meal}>
            <h3>{meal.name}</h3>
            <p className={classes.description}>{meal.description}</p>
            <p className={classes.price}>Rs. {meal.price}</p>
          </div>
        );
      })}
    </div>
  );
}

export default MealsCart;
